import React from 'react';
import './App.css';
import Navbar from "./components/Navbar/index.js"

function App() {
  return (
<div className="App">
          <Router>
      <div>
        <Navbar />
        <Switch>
          <Route exact path={["/", "/login"]}>
            <Login />
            <Arrow />
            <About />
          </Route>
        </Switch>
      </div>
    </Router>
    </div>
  );
}

export default App;
